import Card from 'react-bootstrap/Card'

class SimpleCard extends React.Component{
  render () {
    let name = "test"
    return(
      <Card>
        <Card.CardTitle>
          {name}
        </Card.CardTitle>
      </Card>
    );
  }
}

class Hand extends React.Component{
  renderSimpleHand(){
    return <SimpleCard />
  }
  render () {
    return(
      <div>
        {this.renderSimpleHand()}
        {this.renderSimpleHand()}
        {this.renderSimpleHand()}
        {this.renderSimpleHand()}
      </div>
    );
  }
}

export default Hand;
